import React from "react";
import './App.css';
import { Route, Routes } from 'react-router-dom'
import {Inicio,Catalogo} from  './Layouts'

function App() {

    return (
      <>
      <Routes>
        <Route exact path="/" element={<Inicio/>} />
        <Route path="/catalogo" element={<Catalogo/>} />
      </Routes>
      </>
    );
}

export default App;
